            "created": 1417881835000, 
            "description": "<p>Sites like data.gov and arlington.co.va don't offer advanced search. It's possible to do an advanced search on sites like these without downloading the entire database. In this talk I am going to demonstrate a tool-set which allows advanced search of sites like these. These tools are context based. These easy-to-use tools offer the capacity to preform highly articulated searches combining multiple websites.</p>", 
